#Normality test
from scipy.stats import shapiro, normaltest
results = {}
for col in df.select_dtypes(include='number').columns:
    stat, p = shapiro(df[col])
    results[col] = p

print("Normality test (Shapiro-Wilk):")
for col, p in results.items():
    print(f"{col}: p={p:.4f} {'Normal' if p>0.05 else 'Not normal'}")

"""summary of the test: since all features are not normal,proceed with Kruskal Test"""

import pandas as pd
import scipy.stats as stats
#Keep only numeric features
num_features = df.select_dtypes(include="number").columns.drop("NSP")

results = {}

#Loop through each feature and run Kruskal-Wallis test
for col in num_features:
    groups = [df[df["NSP"] == cls][col].dropna() for cls in df["NSP"].unique()]

    #Check if any group has no variation
    if any(g.nunique() <= 1 for g in groups):
        continue

    try:
        stat, p = stats.kruskal(*groups)
        results[col] = p
    except ValueError:
        #Just in case something else goes wrong
        continue

#showing result in a df(for easy analysis)
results_df = pd.DataFrame.from_dict(results, orient="index", columns=["p_value"])
results_df["Significant"] = results_df["p_value"] < 0.05

results_df = results_df.sort_values("p_value")
results_df

