from scipy.stats import zscore

outlier_summary = {}

for col in numeric_features:
    #Calculate Z-scores, handling potential NaNs if any remain unexpectedly
    z_scores = zscore(df[col].dropna())

    #Identify potential outliers (absolute Z-score > 3)
    outlier_mask = np.abs(z_scores) > 3
    num_outliers = outlier_mask.sum()

    outlier_summary[col] = num_outliers

#Print the summary of outliers found
print("Number of potential outliers (Z-score > 3) per numeric feature:")
for col, count in outlier_summary.items():
    if count > 0:
        print(f"{col}: {count}")

